webpackJsonp([1544],{"./node_modules/json-loader/index.js!./.cache/json/articles-java-java-loop-types.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h1>Types of Java Loops</h1>\n<p>Java has 4 types of loops - the <code>while</code>, <code>do while</code>, <code>for</code> and <code>for each</code>. While you can pick your favorite and use that almost everywhere, each of them has certain advantages in different applications.</p>\n<p>You can use a <em>debugger</em> (a lot of IDEs have one - check out <a href="http://eclipsetutorial.sourceforge.net/Debugger-Tutorial-Companion-Document.pdf">Eclipse</a>, <a href="https://netbeans.org/kb/docs/java/debug-visual.html">Netbeans</a>, <a href="https://www.jetbrains.com/idea/help/debugging-your-first-java-application.html">IntelliJ</a> etc.), <a href="http://help.eclipse.org/mars/index.jsp?topic=%252Forg.eclipse.jdt.doc.user%252Ftasks%252Ftask-add_line_breakpoints.htm">set up breakpoints</a> and visualize how the following code about loops, works step-by-step.</p>',frontmatter:{title:"Java Loop Types",parent:"/home/stuart/guides/src/pages/articles/java/java-loop-types/index.md absPath of file"}}},pathContext:{slug:"/articles/java/java-loop-types/"}}}});
